#* {{quote-web|fr|date=16-03-2023|author=Cimon Asselin|work=Monde de Stars|title=Alexandra d'OD parle de sa grossesse et livre l'entrevue la plus touchante de la saison à La semaine des 4 Julie|url=https://www.mondedestars.com/tele/alexandra-d-od-parle-de-sa-grossesse-et-livre-l-entrevue-la-plus-touchante-de-la-saison-a-la-semaine-des-4-julie|text=En début d’entrevue, l’animatrice lui parle de sa grossesse, qui n’était pas prévue et Alexandra répond ceci : « On s’est rencontré à OD en septembre pis on a commencé à se voir officiellement, mettons le 20 novembre pis on a officialisé tout début janvier, mais je suis comme tombé enceinte… ben je l’ai su le 17 février. '''Faque''' c’était rapide ! » |t=At the beginning of the interview, the host talks about her pregnancy, which was unplanned & Alexandra responded with: "We met on OD [a T.V. program] in September & we started seeing each other officially, let's say the 20<sup>th</sup> of November & we officialised everything at the beginning of January, but I sort of got pregnant...well I knew by the 17<sup>th</sup> of February. '''So''' that was fast!}}
